import React from 'react'

import './SideBar.css'

const SideBar = () => {
    return (
        <div className='sidebar-wrapper'>
            <label>Dataset</label>
            <select>
                <option value='vortex'>Vortex</option>
            </select>
            <label>Time Step</label>
            <input type="range" min="1" max="100" value="50" class="slider" />
        </div>
    );
}

export default SideBar
